import React, { useRouteMatch } from 'react';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Nav from 'react-bootstrap/Nav';


const AdminMenu = (props) => {

  return (
    <Container>
      <Row className="d-flex justify-content-center">
        <Col style={{ flexDirection: "column" }} md="4">
          <div className="default-box">
            <div className="box-header">Menu</div>
            <Nav className="flex-column">
              <Nav.Link href="/home">Movies</Nav.Link>
              <Nav.Link eventKey="link-1">Directors</Nav.Link>
              <Nav.Link eventKey="link-2">Actors</Nav.Link>
              <Nav.Link eventKey="link-2">Genres</Nav.Link>
            </Nav>
          </div>
        </Col>
      </Row>
    </Container>
  );
}
export default AdminMenu;
